package array

/**
  * leetcode 914
  */
object XOfKindInDeckOfCard {
  def hasGroupsSizeX(deck: Array[Int]): Boolean = {

    if (deck.length < 2) return false

    val group = deck.map(k => (k, 1)).groupBy(_._1).map(e => {
      e._2.length
    }).toList.distinct.sorted


    if (group.length == 1) return true

    var a = group(0)
    var b = group(1)

    var d = f(a, b)

    if (d == 1) return false

    for (i <- group) {
      if (i % d != 0) return false
    }

    true
  }

  def f(a: Int, b: Int): Int = {
    if (b == 0) {
      return a
    } else {
      return f(b, a % b)
    }
  }

